import React from 'react';
import { Card } from 'antd';

const UserProfile = () => {
    return(
        <Card
            actions={[
                <>
                    <div key="twit">개시글<br/>0</div>
                    <div key="faoolwings">팔로잉<br/>0</div>
                    <div key="followers">짹짹<br/>0</div>
                </>
            ]}
        >
            <Card.Meta 
                avatar={<Avatar>GO</Avatar>}
            />
        </Card>
    )
}

export default UserProfile;
